                carinidata.JZJS_K = compendata.JZJS_K;
                carinidata.JZJS_GL = compendata.JZJS_GL;
                carinidata.ISUSE = true;
            }
            else
            {
                ini.INIIO.saveLogInf("该线正常");
                carinidata.ASM_CO = 1;
                carinidata.ASM_HC = 1;
                carinidata.ASM_NO = 1;
                carinidata.VMAS_CO = 1;
                carinidata.VMAS_HC =1;
                carinidata.VMAS_NO =1;
                carinidata.SDS_CO = 1;
                carinidata.SDS_HC = 1;
