                        if (mainPanel.linesbbd.Yrenable)
                        {
                            if (carLogin.carbj.JCFF == "ASM" || carLogin.carbj.JCFF == "VMAS" || carLogin.carbj.JCFF == "JZJS")
                            {
                                StringBuilder temp = new StringBuilder();
