                                {
                                    ini.INIIO.GetPrivateProfileString("测功机上次运转时间", "时间", "", temp, 2048, @".\detectConfig.ini");
                                    string timestring = temp.ToString();
                                    DateTime precgjtime = DateTime.Now;
                                    if (DateTime.TryParse(timestring, out precgjtime))
